use concessionnaire
create table FactureAchat (
	id_facture INT primary key identity,
	num_facture VARCHAR(50)NOT NULL UNIQUE,
	id_voiture INT FOREIGN KEY REFERENCES VoitureVente (id_voiture),
	id_vendeur INT FOREIGN KEY REFERENCES Vendeur (id),
	prix DECIMAL(10,2),
	date DATE
);

drop table FactureAchat
SET IDENTITY_INSERT FactureAchat ON;

